import './SectionOne.css';

export default class SectionOne extends React.Component {
  state = {
    barlus: <i class='fas fa-heartbeat'></i>,
  };

  Ber = () => {
    console.log('barlus');
  };
  render() {
    return (
      <div className='sectionone'>
        <button onClick={this.Ber}>sxme</button>
        <h2>{this.state.barlus}</h2>
      </div>
    );
  }
}
